import React from 'react';
import { useHistory } from 'react-router-dom'; // Importez useHistory pour gérer l'historique de navigation
import Button from 'react-bootstrap/Button'; // Importez la composante Button de Bootstrap

function BoutonRetour() {
  const history = useHistory(); // Récupérez l'historique de navigation

  // Fonction pour retourner à la page précédente
  const handleRetour = () => {
    history.goBack(); // Utilisez la méthode goBack() pour revenir à la page précédente
  };

  return (
    <Button onClick={handleRetour} variant="primary">Retour</Button> // Bouton de retour de Bootstrap qui appelle la fonction handleRetour() au clic
  );
}

export default BoutonRetour;
